import React from 'react';
import { Divider, Flex, Box, Heading, Center,NativeBaseProvider,Text,Button } from "native-base";

  
    const Tabs  = () => {

        return (
            <NativeBaseProvider>
                <Box alignItems="left">
                    <Flex  backgroundColor ="#ffff" direction="row">
        
                    <Button  mx="2" variant="link" colorScheme="grey">
                        Ingredientes
                    </Button>
        
                    <Button mx="2" variant="link" colorScheme="grey">
                        Plato
                    </Button> 
        
                    <Button mx="2" variant="link" colorScheme="grey">
                        Tipo
                    </Button> 
        
                     <Button mx="2" variant="link" colorScheme="grey">
                        Usuario
                    </Button> 
        
        
                    </Flex>
                
                </Box>
                </NativeBaseProvider>
          );
    };
        
        
export default Tabs
